import React from 'react';
import { Link } from 'react-router-dom';
import spiralBind from '../images/spiral-bind.png'; // Adjust the path as necessary
import './landing.css';

const LandingPage = () => {
  return (
    <div className="spiral-container">
      <img src={spiralBind} alt="spiral" />
      <div className="right-side">
        <div className="button-container">
          <button className="button">
            <Link className="button-prop" to="/login">
              <div id="button-text">LOG IN</div>
            </Link>
          </button>
          <p className="text">OR</p>
          <button className="button">
            <Link className="button-prop" to="/createacc">
              <div id="button-text">CREATE ACCOUNT</div>
            </Link>
          </button>
        </div>
      </div>
    </div>
  );
};

export default LandingPage;
